import { useState } from "react"
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
function AddClient()
{
    const [last_name, setFirstName] = useState("");
    const [first_name, setLastName] = useState("");
    const [cin, setCin] = useState("");
    console.log(last_name)
    console.log(first_name)
    console.log(last_name)
    return (
      <Form>
        <div>
          
        </div>
        <FormGroup className="">
            <Label for="">Non</Label>
            <Input  type="text" 
                  value={last_name}
                  onChange={(e) => setFirstName(e.target.value)} placeholder="Nom..." />
        </FormGroup>

        <FormGroup>
            <Label for="">Prénom</Label>
              <Input  type="text" 
                    value={first_name}
                    onChange={(e) => setLastName(e.target.value)}placeholder="Prénom..." />
        </FormGroup>

        <FormGroup>
            <Label for="">Prénom</Label>
                <Input   type="text" 
                        value={cin}
                        onChange={(e) => setCin(e.target.value)} placeholder="CIN..." />
            </FormGroup>
            <Button color="primary">Save</Button>{' '}
        </Form>
    )
}

export default AddClient;
